summary:
Proxy Service to act as Channel Client in order to communicate with APIs
      
      How to use:
      
      using (var proxyService = new ProxyService<IYourService>("URL", Settings.DefaultTimeout))
        {
          service = proxyService.Channel;
          return service.Authenticate(authenticationRequest);
        }

        Also endpoint could be specified in the config file
          <add key="SERVICE_URL:JLL.EMEA.Core.Services.Security.Interfaces.IRbacService" value="http://localhost:51910/RbacService.svc">
